DEELUXEはこちらから<BR><br>

□商品詳細
<br>
■MODEL：CHOICE LARA TF WOMENS<BR>
■小売希望価格：￥39,000+(税)<br>
■カラー：NAVY/BROWN(ネイビー/ブラウン)<br>
■インナー：サーモインナー（成型インナー）<br>
■サイズ(cm)：21.5/22.5/23.5/24.5/25.5/26.5/27.5/28.5/29.5<br>
--------------------------------<br>
-スピードレースタイプ<BR>
-レディースモデル<br>
-フレックス：2 SOFT-MIDIUM<br>
※硬さ(フレックス)5段階 1柔→5硬 <br>
-ジャンル別：フリーラン/サーフスタイル（地形遊び）/ジャンプ/パーク/グラトリ<br>
--------------------------------<br>
■驚異の軽さ！ソフトフレックスシリーズ<br>
ID よりも柔らかくアンクル部分のみ締め分けが可能<br>
背丈を低くバックサイド方向にも柔らかいスタイル重視のモデル<br>
シューレースにC3システムを搭載。<br>
--------------------------------<BR>
自分の足型にフィットするサーモインナーを使用しています。<br>
-サーモインナーは１２０度の専用オーブンで温め、一人一人の足型にオーダーメイド出来るインナーです。きっとあなたの足にベストフィットすることでしょう。インナーを自分の足型に成型することでブーツとのすばらしい一体感が生まれ、よりうまくスノーボードをコントロール出来るようになります。世界にひとつだけのあなたの足型のブーツをつくることが出来ます。<br>
(※DEELUXEブーツ(TF LINER)は、DEELUXE取扱店でのインナー成形が必要となります。ご理解いただきました上でのご購入お願いいたします。)<br>
--------------------------------<br>
■JAPAN正規代理店商品。正規ディーラー捺印保証書、オーナーズクラブカード付属。<br>
メーカーの保障が受けられます。ご安心ください。<br>
--------------------------------<br>
□在庫に関する注意<br>
この商品は当店実店舗でも販売しております。在庫数の更新は随時行っておりますが、お買い上げいただいた商品が、品切れになってしまうこともございます。<br>
